  \"2016-07-27T23:04:24.914639\",\n\t\"name\": \"the-american-eider-in-maine\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The American eider, Maine's only breeding
  sea duck, is known to have nested on 215 coastal islands of the State in 1976. In
  Maine, eiders seem to prefer to nest on relatively small, uninhabited islands. The
  numbers of eiders on the Maine coast have fluctuated greatly since colonial days.
  The major threat to breeding populations of eiders is human disturbance during the
  nesting season. Criteria for determining significant nesting areas for the eider
  duck in Maine are defined and a historical review of eider duck nesting on the Maine
  coast is presented in this report as well as general management recommendations
  and an evaluation of eider duck nesting areas for inclusion on the u201cregister
  of critical areasu201d.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
